import axios from 'axios'

const url="https://covid19.mathdro.id/api"

export const fetchData=async()=>{
    try {
        const {data:{confirmed,deaths,recovered,lastupdate}}=await axios.get(url);
        return data
    } catch (err) {
        return err
    }
}
